"use strict";(self.webpackChunkblog_tools=self.webpackChunkblog_tools||[]).push([[297],{512:(e,s,n)=>{n.r(s),n.d(s,{data:()=>l});const l={key:"v-7311e9c4",path:"/SpringCloud/6-center/6-4-Consul.html",title:"6-4 Consul",lang:"en-US",frontmatter:{},excerpt:"",headers:[{level:2,title:"consul 简介",slug:"consul-简介",children:[]},{level:2,title:"安装 consul",slug:"安装-consul",children:[{level:3,title:"根据解压缩目录配置环境变量",slug:"根据解压缩目录配置环境变量",children:[]},{level:3,title:"查看 consul 环境变量是否配置成功，执行命令出现如下信息代表成功",slug:"查看-consul-环境变量是否配置成功-执行命令出现如下信息代表成功",children:[]},{level:3,title:"启动 consul 服务",slug:"启动-consul-服务",children:[]},{level:3,title:"访问 consul 的 web 服务端口",slug:"访问-consul-的-web-服务端口",children:[]}]}],filePathRelative:"SpringCloud/6-center/6-4-Consul.md",git:{updatedTime:1638143942e3,contributors:[{name:"suanfa8",email:"45396320+suanfa8@users.noreply.github.com",commits:1}]}}},9408:(e,s,n)=>{n.r(s),n.d(s,{default:()=>t});const l=(0,n(6252).uE)('<h1 id="_6-4-consul" tabindex="-1"><a class="header-anchor" href="#_6-4-consul" aria-hidden="true">#</a> 6-4 Consul</h1><p>consul 服务注册中心 启动consul服务注册中心 运行</p><p>consul 客户端 将springcloud 客户端(微服务)</p><h2 id="consul-简介" tabindex="-1"><a class="header-anchor" href="#consul-简介" aria-hidden="true">#</a> consul 简介</h2><p>官方网址：https://www.consul.io</p><p>consul是一个可以提供服务发现，健康检查，多数据中心，Key/Value存储等功能的分布式服务框架，用于实现分布式系统的服务发现与配置。与其他分布式服务注册与发现的方案，使用起来也较为简单。Consul 用 Golang实现，因此具有天然可移植性（支持 Linux、Windows 和 Mac OS X）；安装包仅包含一个可执行文件，方便部署。</p><h2 id="安装-consul" tabindex="-1"><a class="header-anchor" href="#安装-consul" aria-hidden="true">#</a> 安装 consul</h2><p>官方安装视频地址： https://learn.hashicorp.com/consul/getting-started/install.html</p><p>下载 consul：https://www.consul.io/downloads</p><p><img src="https://tva1.sinaimg.cn/large/008i3skNgy1gwtu1iofvpj32380fmwhe.jpg" alt="输入图片说明" title="屏幕截图.png"></p><p><img src="https://images.gitee.com/uploads/images/2021/1027/213326_064129de_426516.png" alt="输入图片说明" title="屏幕截图.png"></p><p>解压之后发现 consul 只有一个脚本文件</p><p><img src="https://images.gitee.com/uploads/images/2021/1027/213410_3cd92362_426516.png" alt="输入图片说明" title="屏幕截图.png"></p><h3 id="根据解压缩目录配置环境变量" tabindex="-1"><a class="header-anchor" href="#根据解压缩目录配置环境变量" aria-hidden="true">#</a> 根据解压缩目录配置环境变量</h3><ul><li>根据安装目录进行环境变量配置 [这里是 macos 和 linux 系统配置]</li></ul><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>vim ~/.zshrc\n\nexport CONSUL_HOME=/Users/liwei/app/consul\nexport PATH=$PATH:$CONSUL_HOME\n\nsource ~/.zshrc\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br></div></div><p><img src="https://images.gitee.com/uploads/images/2021/1027/213340_5f264ed0_426516.png" alt="输入图片说明" title="屏幕截图.png"></p><h3 id="查看-consul-环境变量是否配置成功-执行命令出现如下信息代表成功" tabindex="-1"><a class="header-anchor" href="#查看-consul-环境变量是否配置成功-执行命令出现如下信息代表成功" aria-hidden="true">#</a> 查看 consul 环境变量是否配置成功，执行命令出现如下信息代表成功</h3><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>consul -v\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p><img src="https://tva1.sinaimg.cn/large/008i3skNgy1gvu74azyluj32ae05cmyj.jpg" alt="image-20200710105449741"></p><h3 id="启动-consul-服务" tabindex="-1"><a class="header-anchor" href="#启动-consul-服务" aria-hidden="true">#</a> 启动 consul 服务</h3><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>consul agent -dev\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p><img src="https://tva1.sinaimg.cn/large/008i3skNgy1gvu755119pj32i20d6n1e.jpg" alt="image-20200710105654356"></p><h3 id="访问-consul-的-web-服务端口" tabindex="-1"><a class="header-anchor" href="#访问-consul-的-web-服务端口" aria-hidden="true">#</a> 访问 consul 的 web 服务端口</h3><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>http://localhost:8500\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><ul><li>consul 默认服务端口是 8500</li></ul><p><img src="https://tva1.sinaimg.cn/large/008i3skNgy1gvu75rxsnoj32ki0fmjtn.jpg" alt="image-20200710105912943"></p>',27),a={},t=(0,n(3744).Z)(a,[["render",function(e,s){return l}]])},3744:(e,s)=>{s.Z=(e,s)=>{const n=e.__vccOpts||e;for(const[e,l]of s)n[e]=l;return n}}}]);